import React from 'react';
import { View, Button, Text } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createStackNavigator } from '@react-navigation/stack';

const Tab = createBottomTabNavigator();
const Stack = createStackNavigator();

const TelaInicial = ({ navigation }) => {
  return (
    <View>
      <Text>Tela Inicial</Text>
      <Button
        title="Ir para Tela A"
        onPress={() => navigation.navigate('TelaA')}
      />
      <Button
        title="Ir para Tela B"
        onPress={() => navigation.navigate('TelaB')}
      />
    </View>
  );
};

const TelaA = ({ navigation }) => {
  return (
    <View>
      <Text>Tela A</Text>
      <Button title="Voltar" onPress={() => navigation.goBack()} />
    </View>
  );
};

const TelaB = ({ navigation }) => {
  return (
    <View>
      <Text>Tela B</Text>
      <Button title="Voltar" onPress={() => navigation.goBack()} />
    </View>
  );
};

const PerfilPage = () => {
  return (
    <Tab.Navigator>
      <Tab.Screen name="Tela Inicial" component={TelaInicial} />
    </Tab.Navigator>
  );
};

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Perfil" component={PerfilPage} />
        <Stack.Screen name="TelaA" component={TelaA} />
        <Stack.Screen name="TelaB" component={TelaB} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
